#include <stdio.h>
#include <stdlib.h>

int mod = 1e9 + 7;

long long dp[1 << 14][14];

int gcd(int a, int b) {
    while (b != 0) {
        int t = b;
        b = a % b;
        a = t;
    }
    return a;
}

int specialPerm(int* nums, int numsSize) {
    for (int i = 0; i < (1 << numsSize); ++i)
        for (int j = 0; j < numsSize; ++j)
            dp[i][j] = 0;

    for (int i = 0; i < numsSize; ++i)
        dp[1 << i][i] = 1;

    for (int mask = 0; mask < (1 << numsSize); ++mask) {
        for (int i = 0; i < numsSize; ++i) {
            if (mask & (1 << i)) {
                for (int j = 0; j < numsSize; ++j) {
                    if (!(mask & (1 << j)) && (nums[i] % nums[j] == 0 || nums[j] % nums[i] == 0)) {
                        dp[mask | (1 << j)][j] = (dp[mask | (1 << j)][j] + dp[mask][i]) % mod;
                    }
                }
            }
        }
    }

    long long ans = 0;
    for (int i = 0; i < numsSize; ++i) {
        ans = (ans + dp[(1 << numsSize) - 1][i]) % mod;
    }

    return (int)ans;
}
